import React from "react";
import styled from "styled-components";

const AboutEC_Page = styled.div`
  height: 1299px;
  background-color: #f2f2f2;
`;

const AboutEcContainer = styled.div`
  max-width: 1280px;
`;

function AboutEC() {
  return (
    <AboutEC_Page>
      <AboutEcContainer></AboutEcContainer>
    </AboutEC_Page>
  );
}

export default AboutEC;
